import "../css/Loading.css";

const generateBlock = (type) =>{
    if(type ="T"){
        return <div className="block-T"></div>
    }else if(type = "I"){
        return <div className="block-I"></div>
    }
}
const Loading = () => {
    <div className="loading">
        generateBlock("T");
    </div>
}



export default Loading;
